// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/access/AccessControlEnumerable.sol";


struct BlockchainInfo {
    uint256 blockchainId;
    bytes32 name;
}

uint256 constant MAX_NUMBER_OF_BLOCKCHAINS = 255;

contract BlockchainManager is Ownable, AccessControlEnumerable {
    /**
    CONSTANTS
    */
    bytes32 public constant BLOCKCHAIN_MANAGER_ROLE =
        keccak256("BLOCKCHAIN_MANAGER_ROLE");

    using EnumerableSet for EnumerableSet.UintSet;

    /******************************
        EVENTS
    ******************************/

    event blockchainAdded(uint256 id);
    event blockchainRemoved(uint256 id);

    //Modifiers
    modifier onlyRegisteredBlockchains(uint256 blockchainId) {
        require(registeredIds.contains(blockchainId), "NOTFNDS");
        _;
    }

    modifier onlyBlockchainManager() {
        require(
            hasRole(BLOCKCHAIN_MANAGER_ROLE, _msgSender()),
            "Unauthorize. Must has blockchain Manager role"
        );
        _;
    }

    // Blockchains
    mapping(uint256 => BlockchainInfo) registeredBlockchains;
    // List of Id for quick
    EnumerableSet.UintSet registeredIds;

    constructor() {
        _setupRole(DEFAULT_ADMIN_ROLE, _msgSender());
        _setupRole(BLOCKCHAIN_MANAGER_ROLE, _msgSender());
    }

    /**
     * @notice register blockchain
     * @param blockchainId blockchain Id
     * @param name blockchain short name
     */
    function registerBlockchain(
        uint256 blockchainId,
        bytes32 name
    )
        public
        onlyBlockchainManager
    {
        require(blockchainId <= MAX_NUMBER_OF_BLOCKCHAINS, "OUTRG");
        require(
            !registeredIds.contains(blockchainId),
            "FND"
        );
        registeredIds.add(blockchainId);
        BlockchainInfo storage blockchainInfo = registeredBlockchains[blockchainId];
        blockchainInfo.blockchainId = blockchainId;
        blockchainInfo.name = name;
        emit blockchainAdded(blockchainId);
    }

     /**
     * @notice remove blockchain
     * @param blockchainId blockchain Id
     */
    function removeBlockchain(uint256 blockchainId)
        public
        onlyBlockchainManager
        onlyRegisteredBlockchains(blockchainId)
    {
        registeredIds.remove(blockchainId);
        delete registeredBlockchains[blockchainId];
        emit blockchainRemoved(blockchainId);
    }

    /**
    * @notice get all blockchains Ids.
    * Return the entire set in an array
    //
    // WARNING	This operation will copy the entire storage to memory,
    // which can be quite expensive. This is designed to mostly be used by view
    // accessors that are queried without any gas fees.
    // Developers should keep in mind that this function
    // has an unbounded cost, and using it as part of a state-changing
    // function may render the function uncallable if the set grows to a
    // point where copying to memory consumes too much gas to fit in a block.
    */
    function getAllBlockchainIds() public view returns (uint256[] memory) {
        return registeredIds.values();
    }

    /**
     * @notice get blockchain by id.
     * Return the entire set in an array
     * @param id blockchain id
     */
    function getBlockchain(uint256 id)
        public
        view
        onlyRegisteredBlockchains(id)
        returns (BlockchainInfo memory)
    {
        return registeredBlockchains[id];
    }

    /**
     * @notice verify id.
     * if the blockchain exist
     * @param id blockchain id
     */
    function existBlockchain(uint id)
        public
        view
        returns (bool)
    {
        return registeredIds.contains(id);
    }    
 }

